		var pre = "",suf = "";
		if(prefix != null && prefix != "" && typeof(prefix) != "undefined"){
			pre = prefix;	
		}
		if(suffix != null && suffix != "" && typeof(suffix) != "undefined"){
			suf = suffix;	
		}
		var randNum = Math.random()*1000;
		randNum = randNum.toFixed(0);
		var tm=new Date();
